import React, { Component } from "react";
import "./Home.css";
import PlayerChevron from "../components/PlayerChevron"



class Table extends Component{
    constructor(props) {
        super(props);
        console.log('ts called');

       // this.state.gameData = {}
       const chevrons = [];

      }
    componentDidMount() {
        this.createPlayers(this.props);      

    }
    createPlayers(props) {
        const seats = props.gameData.seats;
        //const seats = [{userid:'mike',balance:"10"},{userid:'jim',balance:"10"},{userid:'mike',balance:"10"}];
        this.chevrons = Object.keys(seats).map(function(i) {
            return <PlayerChevron name={seats[i].userid} balance={seats[i].balance}></PlayerChevron>
        })
}

render () {
  return (
    <div className="Table">
       {this.props.jim}
       {JSON.stringify(this.props.gameData)}
       {this.chevrons}
    </div>
  );
    }
}

export default Table
